def isValidRow(row): 
    '''
    return ( true/false , None/field_name ) # first field_name in check_field list
    
    check if row is valid
    assumed a row is valid if it has value in below column 
    
    ENROLLMENT    (unique no.)
    NAME          (student name)
    MODE          (YEAR/SEM)
    EACC_NAME     (study center)
    SESSION       (batch)
    COURSE        (ex:- B.E)
    
    '''
    check_field=['ENROLLMENT','NAME','MODE','EACC_NAME','SESSION','COURSE']
    for f in check_field:
        if row[f]:pass
        else:
            return (False,f)
    return (True,None)

