def getAllUniqueValuesForField(field_name,db,skip_rows):
    unique_list=[]
    #skip_rows are rows raises ValueError while accessing
    for index in xrange(len(db)):
        row=None
        try:
            row=db[index] if index not in skip_rows else None
        except ValueError:
            unique_list.append('ERROR AT INDEX:'+str(index))
        if row:
            unique_list.append(row[field_name])
    return set(unique_list)

        
